import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';
import { PeticionesService } from '../services/peticiones.service';

@Component({
  selector: 'app-externo',
  templateUrl: './externo.component.html',
  styleUrls: [
    './externo.component.css',
  ],
  providers: [PeticionesService]
})

export class ExternoComponent {

  public user: any;
  public userId: number;
  public fecha: any;
  public new_user: any;
  public user_created: any;

  constructor(private _peticionesService: PeticionesService) {
    this.userId = 1;
    this.new_user = {
      "name": '',
      "job": ''
    };
  }

  ngOnInit() {
    this.peticionUsuario();
    this.fecha = new Date;
  }

  peticionUsuario() {
    this._peticionesService.getUser(this.userId).subscribe(
      result => {
        this.user = result.data;
        //console.log(result);
      },
      error => {
        console.log(<any>error);
      }
    );
  }
  //Para crear new_user
  onSubmit(form: { reset: () => void; }) {
    this._peticionesService.addUser(this.new_user).subscribe(
      response => {
        alert(response);
        this.user_created = response;
        form.reset();
      },
      error => {
        alert(<any>error);
      }
    );
    }
}
<h1>externo.component.html</h1>
<hr>
<strong>{{fecha}}</strong>
<hr>
<hr>
<strong>{{fecha | date:'dd/MM/yyyy'}}</strong>
<hr>
<hr>
<strong>{{fecha | date:'fullDate'}}</strong>
<hr>
<hr>
<strong>{{4 | calculadora:5}}</strong>
<hr>
<div>
  <input type="text" [(ngModel)]="userId" (keyup.enter)="peticionUsuario()">
  <div *ngIf="!user">cargando...  :(</div>
</div>
<div>
  <div *ngIf="user">
    <img src="{{user.avatar}}" alt="{{user.first_name + ' ' + user.last_name}}" width="170px">
    <h2>{{user.first_name + ' ' + user.last_name}}</h2>
  </div>
</div>
<hr>
<div>
  <form #newUser="ngForm" (ngSubmit)="onSubmit(newUser)">
    <div>
      <label for="name">Nombre</label>
      <input type="text" name="name" #name="ngModel" [(ngModel)]="new_user.name" required>
      <span *ngIf="name.touched && !name.valid" [ngStyle]color:red>
        El nombre no es válido!
      </span>
    </div>
    <div>
      <label for="job">Trabajo</label>
      <input type="text" name="job" #job="ngModel" [(ngModel)]="new_user.job" required>
      <span *ngIf="job.touched && !job.valid" [ngStyle]color:red>
        El trabajo no es válido!
      </span>
    </div>
    <div>
      <input type="submit" value="Crear nuevo susuario" [disabled]="!new_user.form.valid">
    </div>
<div *ngIf="user_created">
  <h2>Usuario creado correctamente</h2>

</div>
  </form>
</div>
